import React from 'react';

function ProjectCard({project}) {
    return (
        <div className='projectCard'>
            <img src={project.image} />
            <div className='projectDetails'></div>
            <h1>{project.title}</h1>
            <p>{ project.details }</p>
      </div>
  )
}

export default ProjectCard;
